/*********************************************************************
*
*       MainTask
*/
void MainTask(void);
void MainTask(void) {
  GUI_MEMDEV_Handle ahMem[2];
  GUI_MEMDEV_Handle hMemWork;
  GUI_MEMDEV_Handle hLogo;
  void              (* apFunc[])(int, int, GUI_MEMDEV_Handle, GUI_MEMDEV_Handle) = { _Paint0, _Paint1 };
  int               xSize;
  int               ySize;
  unsigned          i;
  int               j;
  int               TimeStart;
  int               TimeNow;
  int               Cnt;
  int               ResultFading;
  int               ResultDrawing;
  int               ResultTotal;

  GUI_Init();
  //
  // Check if recommended memory for the sample is available
  //
  if (GUI_ALLOC_GetNumFreeBytes() < RECOMMENDED_MEMORY) {
    GUI_ErrorOut("Not enough memory available."); 
    return;
  }
  xSize = LCD_GetXSize();
  ySize = LCD_GetYSize();
  //
  // Create logo device
  //
  hLogo = GUI_MEMDEV_CreateFixed(0, 0, _bmSeggerLogo_160x80.XSize, _bmSeggerLogo_160x80.YSize, GUI_MEMDEV_NOTRANS, GUI_MEMDEV_APILIST_32, COLOR_CONV);
  GUI_MEMDEV_Select(hLogo);
  GUI_SetBkColor(GUI_TRANSPARENT);
  GUI_Clear();
  GUI_DrawBitmap(&_bmSeggerLogo_160x80, 0, 0);
  //
  // Create work device
  //
  hMemWork = GUI_MEMDEV_CreateFixed(0, 0, xSize, ySize, GUI_MEMDEV_NOTRANS, GUI_MEMDEV_APILIST_32, COLOR_CONV);
  //
  // Create screen devices
  //
  for (i = 0; i < GUI_COUNTOF(ahMem); i++) {
    ahMem[i] = GUI_MEMDEV_CreateFixed(0, 0, xSize, ySize, GUI_MEMDEV_HASTRANS, GUI_MEMDEV_APILIST_32, COLOR_CONV);
    GUI_MEMDEV_Select(ahMem[i]);
    apFunc[i](xSize, ySize, hLogo, ahMem[i]);
  }
  GUI_MEMDEV_Select(0);
  //
  // Animation loop
  //
  while (1) {
    //
    // Show fading
    //
    for (j = 0; j < 2; j++) {
      for (i = 0; i < GUI_COUNTOF(ahMem); i++) {
        GUI_MEMDEV_FadeDevices(ahMem[i], ahMem[i ^ 1], 1000);
        if (i == 0) {
          GUI_Delay(1000);
        }
      }
      if (j == 0) {
        GUI_Delay(1000);
      }
    }
    //
    // Measure drawing performance
    //
    GUI_MEMDEV_CopyFromLCD(hMemWork);
    TimeStart = GUI_GetTime();
    Cnt = 0;
    do {
      GUI_MEMDEV_Write(hMemWork);
      TimeNow = GUI_GetTime();
      Cnt++;
    } while (TimeNow < (TimeStart + 1000));
    ResultDrawing = (xSize * ySize * Cnt) / (TimeNow - TimeStart);
    //
    // Measure total performance
    //
    TimeStart = GUI_GetTime();
    Cnt = 0;
    do {
      GUI_MEMDEV__FadeDevice(ahMem[0], ahMem[1], hMemWork, Cnt & 0xff);
      GUI_MEMDEV_Write(hMemWork);
      TimeNow = GUI_GetTime();
      Cnt++;
    } while (TimeNow < (TimeStart + 1000));
    ResultTotal  = (xSize * ySize * Cnt) / (TimeNow - TimeStart);
    //
    // Short message
    //
    GUI_MEMDEV_Select(ahMem[0]);
    _DrawMessage(xSize, ySize);
    GUI_MEMDEV_Select(ahMem[1]);
    GUI_MEMDEV_Write(hMemWork);
    GUI_MEMDEV_Select(0);
    GUI_MEMDEV_FadeDevices(ahMem[0], ahMem[1], 1000);
    GUI_Delay(2000);
    //
    // Measure fading performance
    //
    TimeStart = GUI_GetTime();
    Cnt = 0;
    do {
      GUI_MEMDEV__FadeDevice(ahMem[0], ahMem[1], hMemWork, Cnt & 0xff);
      TimeNow = GUI_GetTime();
      Cnt++;
    } while (TimeNow < (TimeStart + 1000));
    ResultFading  = (xSize * ySize * Cnt) / (TimeNow - TimeStart);
    //
    // Draw result(s)
    //
    GUI_MEMDEV_Select(ahMem[1]);
    _DrawResult(xSize, ySize, ResultDrawing, ResultFading, ResultTotal);
    GUI_MEMDEV_Select(0);
    GUI_MEMDEV_FadeDevices(ahMem[1], ahMem[0], 1000);
    GUI_Delay(10000);
    //
    // Fade out...
    //
    GUI_MEMDEV_Select(ahMem[0]);
    GUI_SetBkColor(GUI_BLACK);
    GUI_Clear();
    GUI_MEMDEV_Select(0);
    GUI_MEMDEV_FadeDevices(ahMem[0], ahMem[1], 1000);
    GUI_MEMDEV_Select(ahMem[1]);
    apFunc[1](xSize, ySize, hLogo, ahMem[1]);
    GUI_MEMDEV_Select(0);
    GUI_MEMDEV_FadeDevices(ahMem[1], ahMem[0], 1000);
    GUI_MEMDEV_Select(ahMem[0]);
    apFunc[0](xSize, ySize, hLogo, ahMem[0]);
    GUI_MEMDEV_Select(0);
    GUI_Delay(1000);
  }
}

